class Solution:
    def maxOperations(self, s: str) -> int:
        countOne = 0
        wasOne = False
        res = 0
        for c in s:
            # print(c, countOne, wasOne, res)
            if c == '1':
                countOne += 1
                wasOne = True
            elif wasOne:
                res += countOne
                wasOne = False
        return res
